rules.text:
{fontsize-18}Deathtouch
{i}Landfall {-}{/i} Whenever a land you control enters, put a bounty counter on target creature an opponent controls.
{i}Bounty {-}{/I} Whenever a creature an opponent controls with a bounty counter on it dies, you may search your library for a basic land card, reveal it, put it into your hand, then shuffle.{/fontsize-18}
